package org;

public class SecondExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// >,<,>=,<=,==,!=
		// it returns true or false
		int a,b;
		a=500;
		b=400;
		boolean res;
		res=a>b;
		System.out.println("Result  is ->" +res);
		res=a<b;
		System.out.println("Result  is ->" +res);
		res=a>=b;
		System.out.println("Result  is ->" +res);
		res=a<=b;
		System.out.println("Result  is ->" +res);
		res=a==b;
		System.out.println("Result  is ->" +res);
		res=a!=b;
		System.out.println("Result  is ->" +res);
		
	}

}
